import CanvasLasso from '../index';

const base64String = '';
const catImgUrl = 'cat.jpg';

function prepend(elToInsert, parentEl) {
    if (!parentEl.firstChild) { // don matter
        parentEl.appendChild(elToInsert);
    } else {
        parentEl.insertBefore(elToInsert, parentEl.firstChild);
    }
    return elToInsert;
}


const canvasA = new CanvasLasso(catImgUrl);
const canvasB = new CanvasLasso(base64String);
prepend(canvasA, document.body);
prepend(canvasB, document.body);
